impl Solution {
    pub fn minimize_concatenated_length(words: Vec<String>) -> i32 {
        let n = words.len();
        let mut dp = vec![vec![i32::MAX; n]; n];
        let mut cost = vec![vec![0; n]; n];

        for i in 0..n {
            for j in 0..n {
                if i == j {
                    dp[i][j] = words[i].len() as i32;
                } else {
                    let last_char_i = words[i].chars().last().unwrap();
                    let first_char_j = words[j].chars().next().unwrap();
                    cost[i][j] = if last_char_i == first_char_j {
                        (words[i].len() + words[j].len() - 1) as i32
                    } else {
                        (words[i].len() + words[j].len()) as i32
                    };
                }
            }
        }

        for len in 2..=n {
            for i in 0..=n-len {
                let j = i + len - 1;
                for k in i..j {
                    dp[i][j] = dp[i][j].min(dp[i][k] + cost[k+1][j]);
                    dp[i][j] = dp[i][j].min(dp[i][k] + dp[k+1][j] - if words[k].chars().last() == words[k+1].chars().next() { 1 } else { 0 });
                }
            }
        }

        let mut ans = i32::MAX;
        for i in 0..n {
            ans = ans.min(dp[0][i] + dp[i][n-1] - words[i].len() as i32);
        }
        ans
    }
}
